class TrieNode:
    def __init__(self):
        self.children = {}
        self.is_end_word = False

class Trie:
    def __init__(self):
        self.root = TrieNode()

    def insert(self, word):
        node = self.root
        for char in word:
            if char not in node.children:
                node.children[char] = TrieNode()
            node = node.children[char]
        node.is_end_word = True

    def search(self, word):
        node = self.root
        for char in word:
            if char not in node.children:
                return False
            node = node.children[char]
        return node.is_end_word

def findAllConcatenatedWords(words):
    trie = Trie()

    for word in words:
        if word:
            trie.insert(word)

    def search_word(word, start_index):
        if start_index == len(word):
            return True

        node = trie.root
        for i in range(start_index, len(word)):
            char = word[i]
            if char not in node.children:
                return False
            node = node.children[char]
            if node.is_end_word and search_word(word, i + 1):
                return True

        return False

    concatenated_words = []
    for word in words:
        if word and search_word(word, 0):
            concatenated_words.append(word)

    return concatenated_words
